-- Name: check_edit_time_limit(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.check_edit_time_limit() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Allow edits within 5 minutes of creation
  IF OLD.created_at + INTERVAL '5 minutes' < NOW() THEN
    RAISE EXCEPTION 'Cannot edit message after 5 minutes';
  END IF;

  -- Mark as edited
  NEW.is_edited = TRUE;
  NEW.edited_at = NOW();

  RETURN NEW;
END;
$$;


