--
-- Name: create_announcement_conversation(uuid, text, uuid[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_announcement_conversation(p_season_id uuid, p_title text, p_member_ids uuid[]) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_conversation_id UUID;
  v_member_id UUID;
BEGIN
  -- Check if conversation already exists for this season
  SELECT id INTO v_conversation_id
  FROM conversations
  WHERE scope_type = 'season'
    AND scope_id = p_season_id
    AND conversation_type = 'announcements';

  -- If conversation doesn't exist, create it
  IF v_conversation_id IS NULL THEN
    INSERT INTO conversations (
      title,
      conversation_type,
      scope_type,
      scope_id,
      auto_managed
    )
    VALUES (
      p_title,
      'announcements',
      'season',
      p_season_id,
      true
    )
    RETURNING id INTO v_conversation_id;

    -- Add all members as participants
    FOREACH v_member_id IN ARRAY p_member_ids
    LOOP
      INSERT INTO conversation_participants (
        conversation_id,
        user_id
      )
      VALUES (
        v_conversation_id,
        v_member_id
      )
      ON CONFLICT DO NOTHING;
    END LOOP;
  END IF;

  RETURN v_conversation_id;
END;
$$;


