20251111185444	{"-- Post Nov 5th Schema Updates\n-- Combines all schema changes made between Nov 5th and Nov 11th\n-- These were previously run as individual SQL files\n\n-- ============================================================================\n-- Nov 7: Add game_type column to match_games (for performance)\n-- ============================================================================\n\nALTER TABLE match_games\nADD COLUMN IF NOT EXISTS game_type VARCHAR(20)","-- Backfill game_type from league data\nUPDATE match_games\nSET game_type = leagues.game_type\nFROM matches, seasons, leagues\nWHERE match_games.match_id = matches.id\n  AND matches.season_id = seasons.id\n  AND seasons.league_id = leagues.id\n  AND match_games.game_type IS NULL","-- Make column NOT NULL\nALTER TABLE match_games\nALTER COLUMN game_type SET NOT NULL","-- Add CHECK constraint\nALTER TABLE match_games\nDROP CONSTRAINT IF EXISTS match_games_game_type_check","ALTER TABLE match_games\nADD CONSTRAINT match_games_game_type_check\nCHECK (game_type IN ('eight_ball', 'nine_ball', 'ten_ball'))","-- Add indexes for performance\nCREATE INDEX IF NOT EXISTS idx_match_games_game_type\nON match_games(game_type)","CREATE INDEX IF NOT EXISTS idx_match_games_player_game_type_created\nON match_games(home_player_id, game_type, created_at DESC)\nWHERE winner_player_id IS NOT NULL","CREATE INDEX IF NOT EXISTS idx_match_games_player_game_type_created_away\nON match_games(away_player_id, game_type, created_at DESC)\nWHERE winner_player_id IS NOT NULL","COMMENT ON COLUMN match_games.game_type IS\n  'Denormalized from league for performance. Game type (eight_ball, nine_ball, ten_ball) for fast filtering.'","-- ============================================================================\n-- Nov 8: Add match verification columns\n-- ============================================================================\n\nALTER TABLE public.matches\nADD COLUMN IF NOT EXISTS home_team_verified_by UUID REFERENCES public.members(id) ON DELETE SET NULL,\nADD COLUMN IF NOT EXISTS away_team_verified_by UUID REFERENCES public.members(id) ON DELETE SET NULL","-- Update match_status constraint\nALTER TABLE public.matches\nDROP CONSTRAINT IF EXISTS matches_status_check","ALTER TABLE public.matches\nADD CONSTRAINT matches_status_check\nCHECK (status IN ('scheduled', 'in_progress', 'awaiting_verification', 'completed', 'forfeited', 'postponed'))","COMMENT ON COLUMN public.matches.home_team_verified_by IS 'Member ID of home team player who verified final scores'","COMMENT ON COLUMN public.matches.away_team_verified_by IS 'Member ID of away team player who verified final scores'","-- ============================================================================\n-- Nov 8: Enable realtime for matches table\n-- ============================================================================\n\nDO $$\nBEGIN\n  IF NOT EXISTS (\n    SELECT 1 FROM pg_publication_tables\n    WHERE pubname = 'supabase_realtime' AND tablename = 'matches'\n  ) THEN\n    ALTER PUBLICATION supabase_realtime ADD TABLE public.matches;\n  END IF;\nEND $$","-- ============================================================================\n-- Nov 10: Change game confirmations from boolean to member IDs\n-- ============================================================================\n\n-- Add new UUID columns\nALTER TABLE match_games\nADD COLUMN IF NOT EXISTS confirmed_by_home_member UUID REFERENCES members(id),\nADD COLUMN IF NOT EXISTS confirmed_by_away_member UUID REFERENCES members(id)","-- Drop old boolean columns (only if they exist)\nDO $$\nBEGIN\n  IF EXISTS (SELECT 1 FROM information_schema.columns\n             WHERE table_name='match_games' AND column_name='confirmed_by_home'\n             AND data_type='boolean') THEN\n    ALTER TABLE match_games DROP COLUMN confirmed_by_home;\n  END IF;\n\n  IF EXISTS (SELECT 1 FROM information_schema.columns\n             WHERE table_name='match_games' AND column_name='confirmed_by_away'\n             AND data_type='boolean') THEN\n    ALTER TABLE match_games DROP COLUMN confirmed_by_away;\n  END IF;\nEND $$","-- Rename new columns\nALTER TABLE match_games\nRENAME COLUMN confirmed_by_home_member TO confirmed_by_home","ALTER TABLE match_games\nRENAME COLUMN confirmed_by_away_member TO confirmed_by_away","COMMENT ON COLUMN match_games.confirmed_by_home IS 'Member ID who confirmed this game result for home team'","COMMENT ON COLUMN match_games.confirmed_by_away IS 'Member ID who confirmed this game result for away team'","-- Add games_to_lose columns to matches\nALTER TABLE matches\nADD COLUMN IF NOT EXISTS home_games_to_lose INTEGER,\nADD COLUMN IF NOT EXISTS away_games_to_lose INTEGER","COMMENT ON COLUMN matches.home_games_to_lose IS 'Number of games home team needs to lose the match (based on handicap thresholds)'","COMMENT ON COLUMN matches.away_games_to_lose IS 'Number of games away team needs to lose the match (based on handicap thresholds)'","-- ============================================================================\n-- Nov 10: Add 5v5 lineup support\n-- ============================================================================\n\n-- Rename team_handicap to home_team_modifier (if it exists with old name)\nDO $$\nBEGIN\n  IF EXISTS (SELECT 1 FROM information_schema.columns\n             WHERE table_name='match_lineups' AND column_name='team_handicap') THEN\n    ALTER TABLE match_lineups RENAME COLUMN team_handicap TO home_team_modifier;\n  END IF;\nEND $$","COMMENT ON COLUMN match_lineups.home_team_modifier IS 'Home team standings modifier (bonus/penalty based on season record)'","-- Add player4 and player5 columns\nALTER TABLE match_lineups\nADD COLUMN IF NOT EXISTS player4_id UUID REFERENCES members(id),\nADD COLUMN IF NOT EXISTS player4_handicap DECIMAL(3,1),\nADD COLUMN IF NOT EXISTS player5_id UUID REFERENCES members(id),\nADD COLUMN IF NOT EXISTS player5_handicap DECIMAL(3,1)","COMMENT ON COLUMN match_lineups.player4_id IS 'Fourth player ID (used for 5v5 matches in 8-man team format)'","COMMENT ON COLUMN match_lineups.player4_handicap IS 'Fourth player handicap at time of lineup lock (used for 5v5 matches)'","COMMENT ON COLUMN match_lineups.player5_id IS 'Fifth player ID (used for 5v5 matches in 8-man team format)'","COMMENT ON COLUMN match_lineups.player5_handicap IS 'Fifth player handicap at time of lineup lock (used for 5v5 matches)'"}	post_nov5_schema_updates
20251114031348	{"/**\n * @fileoverview Fix match_lineups UPDATE policy to allow unlocking\n *\n * PROBLEM: The current UPDATE policy has `locked = false` in the USING clause,\n * which prevents users from unlocking lineups because USING checks the CURRENT\n * state of the row (locked = true), not the desired state.\n *\n * SOLUTION: Remove the locked check from USING (which controls WHO can update)\n * and only keep it in WITH CHECK (which controls WHAT can be updated to).\n * We want team members to be able to update their lineup regardless of current\n * lock status, but we don't want to impose restrictions on what locked value\n * they can set (they need to be able to toggle it).\n */\n\n-- Drop the existing restrictive policy\nDROP POLICY IF EXISTS \\"Team members can update unlocked lineup\\" ON match_lineups","-- Create new policy that allows team members to update their lineup\n-- regardless of lock status\nCREATE POLICY \\"Team members can update their lineup\\"\n  ON match_lineups\n  FOR UPDATE\n  USING (\n    EXISTS (\n      SELECT 1 FROM team_players tp\n      JOIN members m ON m.id = tp.member_id\n      WHERE tp.team_id = match_lineups.team_id\n        AND m.user_id = auth.uid()\n    )\n    -- Removed: AND locked = false\n    -- Team members can update their lineup whether it's locked or unlocked\n  )\n  WITH CHECK (\n    EXISTS (\n      SELECT 1 FROM team_players tp\n      JOIN members m ON m.id = tp.member_id\n      WHERE tp.team_id = match_lineups.team_id\n        AND m.user_id = auth.uid()\n    )\n    -- No restrictions on what they can update to\n    -- This allows toggling locked status and updating player selections\n  )"}	fix_match_lineups_unlock_policy
20251114031742	{"-- Add vacate_requested_by column to match_games\n-- This preserves confirmation UUIDs when vacate is requested\n-- Instead of clearing confirmations (losing data), we set this flag\n\nALTER TABLE match_games\nADD COLUMN vacate_requested_by VARCHAR(4) CHECK (vacate_requested_by IN ('home', 'away'))","-- Column is nullable - null means no vacate request pending\n-- 'home' means home team requested vacate\n-- 'away' means away team requested vacate\n\nCOMMENT ON COLUMN match_games.vacate_requested_by IS 'Indicates which team requested to vacate this game score. NULL = no request, ''home'' = home team requested, ''away'' = away team requested. Preserves original confirmation UUIDs during vacate request flow.'"}	add_vacate_requested_by
20251114032917	{"/**\n * @fileoverview Remove unnecessary NULL constraint on match_lineups\n *\n * The constraint assumed substitutes would be NULL player_ids, but that's wrong.\n * Substitutes are actual members in the system with UUIDs, just like regular players.\n * There's no reason to restrict NULL fields - empty lineups can have all NULLs,\n * and filled lineups should have all real UUIDs (including substitutes).\n */\n\n-- Drop the unnecessary constraint\nALTER TABLE match_lineups\nDROP CONSTRAINT IF EXISTS match_lineups_check"}	remove_unnecessary_lineup_constraint
20251115000000	{"-- Migration: Auto-create match lineups on match insert\n-- Purpose: Automatically create empty lineup records for both home and away teams\n--          when a new match is created. This ensures real-time subscriptions have\n--          records to watch and eliminates the need for client-side lineup creation logic.\n-- Date: 2025-11-15\n\n-- Create function to auto-create lineups for a new match\nCREATE OR REPLACE FUNCTION auto_create_match_lineups()\nRETURNS TRIGGER AS $$\nDECLARE\n  home_lineup_uuid UUID;\n  away_lineup_uuid UUID;\nBEGIN\n  -- Create empty home team lineup\n  INSERT INTO match_lineups (\n    match_id,\n    team_id,\n    player1_id,\n    player1_handicap,\n    player2_id,\n    player2_handicap,\n    player3_id,\n    player3_handicap,\n    player4_id,\n    player4_handicap,\n    player5_id,\n    player5_handicap,\n    home_team_modifier,\n    locked,\n    locked_at\n  ) VALUES (\n    NEW.id,\n    NEW.home_team_id,\n    NULL,\n    0,\n    NULL,\n    0,\n    NULL,\n    0,\n    NULL,\n    0,\n    NULL,\n    0,\n    0,\n    false,\n    NULL\n  ) RETURNING id INTO home_lineup_uuid;\n\n  -- Create empty away team lineup\n  INSERT INTO match_lineups (\n    match_id,\n    team_id,\n    player1_id,\n    player1_handicap,\n    player2_id,\n    player2_handicap,\n    player3_id,\n    player3_handicap,\n    player4_id,\n    player4_handicap,\n    player5_id,\n    player5_handicap,\n    home_team_modifier,\n    locked,\n    locked_at\n  ) VALUES (\n    NEW.id,\n    NEW.away_team_id,\n    NULL,\n    0,\n    NULL,\n    0,\n    NULL,\n    0,\n    NULL,\n    0,\n    NULL,\n    0,\n    0,\n    false,\n    NULL\n  ) RETURNING id INTO away_lineup_uuid;\n\n  -- Update the match record with the lineup IDs\n  UPDATE matches\n  SET\n    home_lineup_id = home_lineup_uuid,\n    away_lineup_id = away_lineup_uuid\n  WHERE id = NEW.id;\n\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER","-- Create trigger to run after match insert\nDROP TRIGGER IF EXISTS trigger_auto_create_match_lineups ON matches","CREATE TRIGGER trigger_auto_create_match_lineups\n  AFTER INSERT ON matches\n  FOR EACH ROW\n  EXECUTE FUNCTION auto_create_match_lineups()","-- Add comment explaining the trigger\nCOMMENT ON FUNCTION auto_create_match_lineups() IS\n'Automatically creates empty lineup records for both home and away teams when a new match is inserted. This ensures real-time subscriptions have records to watch and eliminates client-side lineup creation logic.'"}	auto_create_match_lineups
20251115205917	{"-- Migration: Auto-delete match lineups on match delete\n-- Purpose: Automatically delete lineup records for both home and away teams\n--          when a match is deleted. This ensures orphaned lineup records\n--          don't remain in the database after match deletion.\n-- Date: 2025-11-15\n\n-- Create function to auto-delete lineups when a match is deleted\nCREATE OR REPLACE FUNCTION auto_delete_match_lineups()\nRETURNS TRIGGER AS $$\nBEGIN\n  -- Delete home team lineup if it exists\n  IF OLD.home_lineup_id IS NOT NULL THEN\n    DELETE FROM match_lineups WHERE id = OLD.home_lineup_id;\n  END IF;\n\n  -- Delete away team lineup if it exists\n  IF OLD.away_lineup_id IS NOT NULL THEN\n    DELETE FROM match_lineups WHERE id = OLD.away_lineup_id;\n  END IF;\n\n  RETURN OLD;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER","-- Create trigger to run before match delete\nDROP TRIGGER IF EXISTS trigger_auto_delete_match_lineups ON matches","CREATE TRIGGER trigger_auto_delete_match_lineups\n  BEFORE DELETE ON matches\n  FOR EACH ROW\n  EXECUTE FUNCTION auto_delete_match_lineups()","-- Add comment explaining the trigger\nCOMMENT ON FUNCTION auto_delete_match_lineups() IS\n'Automatically deletes lineup records for both home and away teams when a match is deleted. This prevents orphaned lineup records and maintains referential integrity.'"}	auto_delete_match_lineups
20251116000000	{"-- Allow substitute players in match lineups and games by removing foreign key constraints\n-- This allows special substitute UUIDs (SUB_HOME_ID, SUB_AWAY_ID) to be stored\n-- in player_id columns without requiring them to exist in the members table.\n--\n-- Substitutes are handled specially in the application:\n-- - SUB_HOME_ID: 00000000-0000-0000-0000-000000000001\n-- - SUB_AWAY_ID: 00000000-0000-0000-0000-000000000002\n\n-- Drop foreign key constraints on match_lineups player columns\nALTER TABLE match_lineups DROP CONSTRAINT IF EXISTS match_lineups_player1_id_fkey","ALTER TABLE match_lineups DROP CONSTRAINT IF EXISTS match_lineups_player2_id_fkey","ALTER TABLE match_lineups DROP CONSTRAINT IF EXISTS match_lineups_player3_id_fkey","ALTER TABLE match_lineups DROP CONSTRAINT IF EXISTS match_lineups_player4_id_fkey","ALTER TABLE match_lineups DROP CONSTRAINT IF EXISTS match_lineups_player5_id_fkey","-- Drop foreign key constraints on match_games player columns\nALTER TABLE match_games DROP CONSTRAINT IF EXISTS match_games_home_player_id_fkey","ALTER TABLE match_games DROP CONSTRAINT IF EXISTS match_games_away_player_id_fkey","ALTER TABLE match_games DROP CONSTRAINT IF EXISTS match_games_winner_player_id_fkey","-- Note: Player IDs are still UUIDs and still nullable\n-- Application code validates that player IDs are either:\n-- 1. Valid member IDs from the members table, OR\n-- 2. Special substitute UUIDs (SUB_HOME_ID or SUB_AWAY_ID)"}	allow_substitute_players_in_lineups
20251120000000	{"-- Add separate verification columns for tiebreaker results\n-- This allows tracking both regular match verification AND tiebreaker verification separately\n\n-- Add tiebreaker verification columns to matches table\nALTER TABLE matches\nADD COLUMN home_tiebreaker_verified_by uuid REFERENCES members(id),\nADD COLUMN away_tiebreaker_verified_by uuid REFERENCES members(id)","-- Add comments explaining the columns\nCOMMENT ON COLUMN matches.home_tiebreaker_verified_by IS 'Member who verified tiebreaker results for home team'","COMMENT ON COLUMN matches.away_tiebreaker_verified_by IS 'Member who verified tiebreaker results for away team'"}	add_tiebreaker_verification_columns
20251122000000	{"-- Change home_points_earned and away_points_earned from integer to numeric(4,1)\n-- This allows decimal points for BCA scoring (e.g., 1.5, 3.0, 4.1)\n\nALTER TABLE matches\n  ALTER COLUMN home_points_earned TYPE numeric(4,1),\n  ALTER COLUMN away_points_earned TYPE numeric(4,1)","-- Add comment explaining the change\nCOMMENT ON COLUMN matches.home_points_earned IS 'Points earned by home team. Uses numeric(4,1) to support BCA scoring with decimal values (e.g., 1.5 for 70% bonus)'","COMMENT ON COLUMN matches.away_points_earned IS 'Points earned by away team. Uses numeric(4,1) to support BCA scoring with decimal values (e.g., 1.5 for 70% bonus)'"}	change_points_to_decimal
